import React from 'react';
import '../App.css'
export default function MainCarosoul() {
    return (
    <div>
        {/*Carousel Wrapper*/}
<div id="video-carousel-example2" style={{height:"30rem"}}   className="carousel slide carousel-fade" data-ride="carousel">
  {/*Indicators*/}
  <ol className="carousel-indicators">
    <li data-target="#video-carousel-example2" data-slide-to={0}  />
    <li data-target="#video-carousel-example2" data-slide-to={1} />
    <li data-target="#video-carousel-example2" data-slide-to={2} />
  </ol>
  {/*/.Indicators*/}
  {/*Slides*/}
  <div className="carousel-inner" role="listbox">
    {/* First slide */}
    <div className="carousel-item active" >
      {/*Mask color*/}
      <div className="view first" >
        {/*Video source*/}
        <img src="assets/img/hero/hero_man.png" style={{float:'left',height:"30rem"}} alt=""/>
        <div className="mask rgba-indigo-light" />
      </div>
      {/*Caption*/}
      <div className="carousel-caption">
        <div className="animated fadeInDown">
       <span data-animation="fadeInRight" data-delay=".4s" style={{WebkitAnimationDelay:"0.4s",animationDelay:"0.4s"}} >60% Discount</span>

        <h1 data-animation="fadeInRight" data-delay=".6s" >Winter <br /> Collection</h1>
        <p data-animation="fadeInRight" data-delay=".8s" style={{WebkitAnimationDelay:"0.8s",animationDelay:"0.8s" ,color:'white'}} >Best Cloth Collection By 2020!</p>                       
        </div>
      </div>
      {/*Caption*/}
    </div>
    {/* /.First slide */}
                    {/* Second slide */}
                    <div className="carousel-item " >
      {/*Mask color*/}
      <div className="view second" >
        {/*Video source*/}
        <img src="assets/img/hero/hero_man.png" style={{float:'left',height:"30rem"}} alt=""/>
        <div className="mask rgba-indigo-light" />
      </div>
      {/*Caption*/}
      <div className="carousel-caption">
        <div className="animated fadeInDown">
       <span data-animation="fadeInRight" data-delay=".4s" style={{WebkitAnimationDelay:"0.4s",animationDelay:"0.4s",color:'white'}} >60% Discount</span>

        <h1 data-animation="fadeInRight" data-delay=".6s" >Winter <br /> Collection</h1>
        <p data-animation="fadeInRight" data-delay=".8s" style={{WebkitAnimationDelay:"0.8s",animationDelay:"0.8s",color:'white'}} >Best Cloth Collection By 2020!</p>                       
        </div>
      </div>
      {/*Caption*/}
    </div>
    {/* /.Second slide */}
                    {/* Third slide */}
                    <div className="carousel-item " >
      {/*Mask color*/}
      <div className="view third" >
        {/*Video source*/}
        <img src="assets/img/hero/hero_man.png" style={{float:'left',height:"30rem"}} alt=""/>
        <div className="mask rgba-indigo-light" />
      </div>
      {/*Caption*/}
      <div className="carousel-caption">
        <div className="animated fadeInDown">
       <span data-animation="fadeInRight" data-delay=".4s" style={{WebkitAnimationDelay:"0.4s",animationDelay:"0.4s"}} >60% Discount</span>

        <h1 data-animation="fadeInRight" data-delay=".6s" >Winter <br /> Collection</h1>
        <p data-animation="fadeInRight" data-delay=".8s" style={{WebkitAnimationDelay:"0.8s",animationDelay:"0.8s"}} >Best Cloth Collection By 2020!</p>                       
        </div>
      </div>
      {/*Caption*/}
    </div>
    {/* /.Third slide */}
  </div>
  {/*/.Slides*/}
  {/*Controls*/}
  <a className="carousel-control-prev" href="#video-carousel-example2" role="button" data-slide="prev">
    <span className="carousel-control-prev-icon" aria-hidden="true" />
    <span className="sr-only">Previous</span>
  </a>
  <a className="carousel-control-next" href="#video-carousel-example2" role="button" data-slide="next">
    <span className="carousel-control-next-icon" aria-hidden="true" />
    <span className="sr-only">Next</span>
  </a>
  {/*/.Controls*/}
</div>
{/*Carousel Wrapper*/}
</div>
    )
}
